import React from 'react';
import './Header.css';


const renderedLinks = () => {
  return (
    <div className="LinkGrid">
      <a href={'/about'}>About</a>
      <a href={'/gallery'}>Gallery</a>
    </div>
  )
}

const Header = () => {
  return (
    <div className="Header">
      <div className="Grid">
        <div className="Logo"><img src="logo.png">      <a href={'/'}>Home</a>
</img></div>
        <nav className="NavLinks">{renderedLinks()}</nav>
        <div className="ActionButton"><button>Call Now</button></div>
      </div>
    </div>
  );
}

export default Header;
